";echo "
<h3>Combining CSS files that contain <code>@import</code></h3>";echo "
<p>If your CSS files contain <code>@import</code> declarations, Minify will not ";echo "
remove them. Therefore, you will want to remove those that point to files already";echo "
in your list, and move any others to the top of the first file in your list ";echo "
(imports below any styles will be ignored by browsers as invalid).</p>";echo "
<p>If you desire, you can use Minify URIs in imports and they will not be touched";echo "
by Minify. E.g. <code>@import \"<span class=minRoot>/min/?</span>g=css2\";</code></p>";echo "
";echo "
